/*Table structure for table `medicine_tab` */

DROP TABLE IF EXISTS `medicine_tab`;

CREATE TABLE `medicine_tab` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `medicine_name` varchar(250) DEFAULT NULL,
  `medicine_type` varchar(250) DEFAULT NULL,
  `expiry_date` date DEFAULT NULL,
  `dosage` varchar(11) DEFAULT NULL,
  `quantity` varchar(11) DEFAULT NULL,
  `rate` varchar(200) DEFAULT NULL,
  `mrp` varchar(200) DEFAULT NULL,
  `sgst` varchar(200) DEFAULT NULL,
  `cgst` varchar(200) DEFAULT NULL,
  `hsn` varchar(200) DEFAULT NULL,
  `mfr` varchar(200) DEFAULT NULL,
  `status` int(11) DEFAULT NULL COMMENT 'active=1,delete=0',
  `created_date` date DEFAULT NULL,
  `updated_date` date DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;

